scene.onOverlapTile(SpriteKind.Player, myTiles.tile18, function (sprite, location) {
    tiles.setTileAt(location, myTiles.tile15)
    info.changeScoreBy(1)
    fiveScore += 1
})
scene.onOverlapTile(SpriteKind.Enemy, sprites.dungeon.hazardLava1, function (sprite, location) {
    tiles.placeOnRandomTile(guyBad, sprites.dungeon.hazardHole)
})
scene.onOverlapTile(SpriteKind.Player, myTiles.tile1, function (sprite, location) {
    if (true) {
        levelNum = 6
        whichLevel()
    } else {
        doorWent()
    }
})
scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.buttonPinkDepressed, function (sprite, location) {
    PA = 1
})
scene.onOverlapTile(SpriteKind.Player, myTiles.tile13, function (sprite, location) {
    guyBad.destroy()
    doorWent()
})
scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.buttonPink, function (sprite, location) {
    PB = 1
})
scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.buttonTeal, function (sprite, location) {
    BB = 1
})
scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.greenSwitchUp, function (sprite, location) {
    if (levelNum == 6) {
        if (blueDone == 1) {
            tiles.setTileAt(location, sprites.dungeon.greenSwitchDown)
            tiles.setTileAt(tiles.getTileLocation(14, 11), sprites.dungeon.purpleSwitchUp)
        } else {
            game.showLongText("get the blue orb first.", DialogLayout.Bottom)
        }
    }
})
scene.onOverlapTile(SpriteKind.Enemy, sprites.dungeon.buttonPinkDepressed, function (sprite, location) {
    tiles.placeOnRandomTile(guyBad, sprites.dungeon.hazardHole)
})
scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.purpleSwitchDown, function (sprite, location) {
    if (levelNum == 5) {
        if (redDone == 1) {
            tiles.setTileAt(location, sprites.dungeon.purpleSwitchUp)
            tiles.setTileAt(tiles.getTileLocation(15, 3), myTiles.tile15)
            tiles.setTileAt(tiles.getTileLocation(14, 5), myTiles.tile15)
            tiles.setTileAt(tiles.getTileLocation(14, 4), myTiles.tile15)
            tiles.setWallAt(tiles.getTileLocation(15, 3), false)
        } else {
            game.showLongText("get the red orb first.", DialogLayout.Bottom)
        }
    }
    if (levelNum == 6) {
        tiles.setTileAt(location, sprites.dungeon.purpleSwitchUp)
        tiles.setTileAt(tiles.getTileLocation(13, 14), sprites.dungeon.buttonTeal)
    } else {
        game.showLongText("get the red orb first.", DialogLayout.Bottom)
    }
})
scene.onOverlapTile(SpriteKind.Player, myTiles.tile12, function (sprite, location) {
    guyBad.destroy()
    doorWent()
})
controller.B.onEvent(ControllerButtonEvent.Pressed, function () {
    if (levelNum >= 6) {
        if (OA == 1) {
            tiles.placeOnRandomTile(guy, sprites.dungeon.buttonOrange)
            OA = 0
        }
        if (OB == 1) {
            tiles.placeOnRandomTile(guy, sprites.dungeon.buttonOrangeDepressed)
            OB = 0
        }
        if (PA == 1) {
            tiles.placeOnRandomTile(guy, sprites.dungeon.buttonPink)
            PA = 0
        }
        if (PB == 1) {
            tiles.placeOnRandomTile(guy, sprites.dungeon.buttonPinkDepressed)
            PB = 0
        }
        if (BA == 1) {
            tiles.placeOnRandomTile(guy, sprites.dungeon.buttonTeal)
            BA = 0
        }
        if (BB == 1) {
            tiles.placeOnRandomTile(guy, sprites.dungeon.buttonTealDepressed)
            BB = 0
        }
    }
})
scene.onOverlapTile(SpriteKind.Enemy, sprites.dungeon.buttonTealDepressed, function (sprite, location) {
    tiles.placeOnRandomTile(guyBad, sprites.dungeon.hazardHole)
})
