scene.onOverlapTile(SpriteKind.Player, sprites.dungeon.hazardLava1, function (sprite, location) {
    if (guy.tileKindAt(TileDirection.Top, sprites.dungeon.hazardLava1)) {
        info.changeLifeBy(0)
    } else if (guy.tileKindAt(TileDirection.Left, sprites.dungeon.hazardLava1)) {
        info.changeLifeBy(0)
    } else {
        info.startCountdown(0.3)
    }
})
controller.A.onEvent(ControllerButtonEvent.Pressed, function () {
    if (numJumps < 1) {
        guy.vy = -180
        numJumps += 1
    }
})
